template<class T>
inline TFCODERandomMatrixOperator<T>::TFCODERandomMatrixOperator(klab::UInt32 m, klab::UInt32 n, const T& mean, const T& deviation, bool normalize, klab::UInt32 f_m) : TMatrixOperator<T>(),
_mean(mean), _deviation(deviation)
{
    arma::Mat<T>& mat = this->matrixReference();

    mat.set_size(m+f_m, n);
    for(klab::UInt32 i=0; i<m; ++i)
    {
        for(klab::UInt32 j=0; j<n; ++j)
            mat(i, j) = this->random_bernoulli_matrix[i][j];
    }

    for(klab::UInt32 i=0; i<f_m; ++i)
    {
        for(klab::UInt32 j=0; j<n; ++j){
            if(((n/f_m)*i)<j && j<(n/f_m)*(i+1)){
                mat(m+i,j)=1;
            }else{
                mat(m+i,j)=0;
            }
        }
    }

    this->resize(m+f_m, n);
	
	if(normalize)
		this->normalize();
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline TFCODERandomMatrixOperator<T>::TFCODERandomMatrixOperator(const TFCODERandomMatrixOperator<T>& op) : TMatrixOperator<T>(op)
{}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline TFCODERandomMatrixOperator<T>::~TFCODERandomMatrixOperator()
{}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline bool TFCODERandomMatrixOperator<T>::isZero()
{
    return (this->m()==0 || this->n()==0 || (klab::Equals(_mean, klab::TTypeInfo<T>::ZERO) && klab::Equals(_deviation, klab::TTypeInfo<T>::ZERO)));
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline T TFCODERandomMatrixOperator<T>::sum()
{
	if(this->isNormalized())
	{
		return TMatrixOperator<T>::sum();
	}
	else
	{
		T ret = klab::TTypeInfo<T>::ZERO;

		klab::UInt32 mn = this->m() * this->n();
		if(mn > 0)
			ret = _mean * static_cast<T>(mn);

		return ret;
	}
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline T TFCODERandomMatrixOperator<T>::normFrobenius()
{
    return klab::Sqrt(this->squaredNormFrobenius());
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline T TFCODERandomMatrixOperator<T>::squaredNormFrobenius()
{
	if(this->isNormalized())
	{
		return TMatrixOperator<T>::squaredNormFrobenius();
	}
	else
	{
		T ret = klab::TTypeInfo<T>::ZERO;

		klab::UInt32 mn = this->m() * this->n();
		if(mn > 0)
			ret = (this->variance() + (klab::Conj(_mean)*_mean)) * static_cast<T>(mn);

		return ret;
	}
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline T TFCODERandomMatrixOperator<T>::mean()
{
	if(this->isNormalized())	return TMatrixOperator<T>::mean();
	else						return _mean;
}

// ---------------------------------------------------------------------------------------------------- //

template<class T>
inline T TFCODERandomMatrixOperator<T>::variance()
{
	if(this->isNormalized())	return TMatrixOperator<T>::variance();
	else						return (klab::Conj(_deviation)*_deviation);
}

